import React, { Component } from "react";
import Columns from "./colums";
class Main extends Component {
  state = {
    data: null
  };
  render() {
    return (
      <div className="row con2 justify-content-center">
        <div className="col-sm-2 bor ">
          <p>Wed</p>
          <i className="wi wi-day-snow size" />
          <p>
            <span className="lead">78</span>
            &#176; &nbsp;&nbsp;
            <span className="text-muted">67</span>
            &#176;
          </p>
        </div>
        <div className="col-sm-2 bor">
          <p>Wed</p>
          <i className="wi wi-day-cloudy size" />
          <p>
            <span className="lead">78</span>
            &#176; &nbsp;&nbsp;
            <span className="text-muted">67</span>
            &#176;
          </p>
        </div>
        <div className="col-sm-2 bor">
          <p>Wed</p>
          <i className="wi wi-day-rain size" />
          <p>
            <span className="lead">78</span>
            &#176; &nbsp;&nbsp;
            <span className="text-muted">67</span>
            &#176;
          </p>
        </div>
        <div className="col-sm-2 bor">
          <p>Wed</p>
          <i className="wi wi-day-sunny size" />
          <p>
            <span className="lead">78</span>
            &#176; &nbsp;&nbsp;
            <span className="text-muted">67</span>
            &#176;
          </p>
        </div>
        <div className="col-sm-2 bor">
          <p>Wed</p>
          <i className="wi wi-day-cloudy size" />
          <p>
            <span className="lead">78</span>
            &#176; &nbsp;&nbsp;
            <span className="text-muted">67</span>
            &#176;
          </p>
        </div>
      </div>
    );
  }
}
export default Main;
